import React from "react";
import img from "../asset/hero.png";
import { Container, Row, Col } from 'react-bootstrap';

const Home = () => {
  return (

    <section className="hero-section">
    <Container fluid className="p-0"> 
      <Row>
        <Col className="p-0"> 
          <img
            src={img}  
            alt="Hero Image"
            className="img-fluid w-100" 
          />
        </Col>
      </Row>
    </Container>
  </section>

  );
};

export default Home;
